import User from "./components/User"
import Navbar from "./components/Navbar"
import React, { Component, useState } from 'react'
import './App.css';

export default class App extends Component{
 state ={
  categorys: [
    { id: 1, catogryNames: "Dodo" },
    { id: 2, catogryNames: "Melo" }
  ],
  conTextt: ''
 }

  change = (cato) => {
    this.setState({ conTextt: cato.catogryNames });
  };

  render() {
 infoke = {title : "Project"}
 infok = {title : "Bar"}
    return (
      <div className="App">
      <h1>Logo</h1>
      <div className="container">

        <User cat = {this.state.categorys} current = {this.state.conTextt} change = {this.change} info ={this.infoke} />
        <Navbar current = {this.state.conTextt} info ={this.infok} cat = {this.state.categorys} /></div>
    </div>
    )}
}
